import React from 'react';
import { Col, Row } from 'antd'; 
/*
// client-side
const io = require("socket.io-client");
const socket = io("https://api.example.com", {
  withCredentials: true,
  extraHeaders: {
    "my-custom-header": "abcd"
  }
});
*/ 
const menuStyle = {
    display:"flex",
    height:"70px",
    position: "fixed",
    bottom:"0",
    zIndex:"99",
    background:"white",
    width:"100%",
    borderTop: "solid thin #EFEEF5",
    display: "flex", 
    justifyContent:"space-evenly",
    alignItems: "center"
};

const test = () => {

    return(
        <Row>
            <Col xs={0} md={2}>
            empty
            </Col>
            <Col xs={0} md={6}>
            menu
            </Col>
            <Col xs={20} md={8}>
            main
            </Col>
            <Col xs={0} md={6}>
            side
            </Col>
            <Col xs={0} md={2}>
            empty
            </Col>
        </Row>
    );
}


export default test;
